import React from 'react';

import './App.css';


const App = () => {
  return (
      <div className="app-wrapper">
        <header>
            <img src="https://upload.wikimedia.org/wikipedia/commons/f/fa/Apple_logo_black.svg" alt=""/>
        </header>
        <nav className="navigation">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
        </nav>
        <div>
          main content
        </div>
      </div>
  )
}

export default App;
